    "2016-10-26T04:53:05.818522",nt"name": "a-seamless-high-resolution-coastal-digital-elevation-model-dem-for-southern-california",nt"isopen":
    false,nt"url": null,nt"notes": "A seamless, three-meter digital elevation
    model (DEM) was constructed for the entire Southern California coastal zone, extending
    473 km from Point Conception to the Mexican border. The goal was to integrate the
    most recent, high-resolution datasets available (for example, Light Detection and
    Ranging (Lidar) topography, multibeam and single beam sonar bathymetry, and Interferometric
    Synthetic Aperture Radar (IfSAR) topography) into a continuous surface from at least
    the 20-m isobath to the +20-m elevation contour.",nt"license_title": null,nt"extras":
